// src/pages/Events.js
import React from 'react';
import EventCard from '../components/EventCard';

const Events = () => {
    const events = []; // Replace with API data

    return (
        <div>
            <h2>All Events</h2>
            <div className="event-list">
                {events.map(event => (
                    <EventCard key={event.id} event={event} />
                ))}
            </div>
        </div>
    );
}

export default Events;
